def calculate_robot_final_position(H, W, L, maze):
    did = {'N': 0, 'E': 1, 'S': 2, 'W': 3}
    dd = [(-1, 0), (0, 1), (1, 0), (0, -1)]
    s = None
    for i in range(H):
        for j in range(W):
            if maze[i][j] in 'NEWS':
                s = (i, j, did[maze[i][j]])
                break
        if s:
            break
    (i, j, dk) = s
    tt = 1
    td = {}
    while tt < L:
        tt += 1
        for ddi in range(4):
            (di, dj) = dd[(dk + ddi) % 4]
            ni = i + di
            nj = j + dj
            if ni < 0 or ni >= H or nj < 0 or (nj >= W) or (maze[ni][nj] == '#'):
                continue
            dk = (dk + ddi) % 4
            i = ni
            j = nj
            break
        if (i, j, dk) in td:
            cycle_length = tt - td[i, j, dk]
            remaining_steps = L - tt
            if cycle_length > 0:
                tt += remaining_steps // cycle_length * cycle_length
            else:
                break
        else:
            td[i, j, dk] = tt
    final_direction = 'NESW'[dk]
    return (i + 1, j + 1, final_direction)

